import React from "react";
import Quotes from './quotes.json';

const Quote = () => {

    const QuoteReader = () => {
        Quotes.map( q => {
            return (
                <div>
                    { q.quote }
                </div>
            );
        })
    };

    return (
        // <div>
        //     <h1>
        //         {QuoteReader}
        //     </h1>
        // </div>
        <div>
            <h1>
                {
                    Quotes.map( q => {
                        return (
                            <div>
                                { q.quote }
                            </div>
                        );
                    })
                }
            </h1>
        </div>
    );
};

export default Quote;
